import React from "react";
import "./style.css";

function SearchForm(props) {
  return (
    <form>
    <div className="form-group">
      <input
        onChange={props.updateSearch}
        value={props.search}
        name="search"
        type="text"
        className="form-control"
        placeholder="Search for an employee"
        id="search"
      />
    </div>
  </form>

  );
}

export default SearchForm;
